const primary_color = '#563D7C';

const MyStyle = {
    col_background: {
        background: {primary_color},
        color: "white",
    },
    col_text: {
        color: "#563D7C"
    },
    col_border: {
        border: '1px solid `{primary_color}`'
    }
}

export default MyStyle;
